import React from 'react';
import './App.css';

const App = () => {
    return (
        <div>
            <Header />
            <technologies />
        </div>
    );
}

const Header = ()=>{
    return (
        <div>Kuku, I'am the content of Header.
        <a href={""}>header css</a>
        <a href={""}>header html</a>
        <a href={""}>header js</a>
        <a href={""}>header react</a>
        </div>
    )
}

const technologies = ()=> {
    return (
        <ul>
            <li>css</li>
            <li>html</li>
            <li>js</li>
            <li>react</li>
        </ul>
    )
}

export default App;
